],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"7a5b65e8-72d8-48a7-b345-82e9d7cbd8cd"},{"version":"CommandV1","origId":3800564025501399,"guid":"03b5a779-3c46-4d11-a230-a4a64f92bec4","subtype":"command","commandType":"auto","position":5.07760351896286,"command":"%md\nCrossValidatorVerbose builds on top of Cross Validator by displaying and storing out from each fold and all the regularization parameters   \nThese values then can be used to compare the models with different regularizations","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":0,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"3bbd9bb5-85e2-4996-a866-1d4e20c172a4"},{"version":"CommandV1","origId":2307478056950140,"guid":"a9c2c6a4-3dd1-4ca7-92f6-ce9264f07b7c","subtype":"command","commandType":"auto","position":5.077603578567505,"command":"class CrossValidatorVerbose(CrossValidator):\n    \n    def _fit(self, dataset):\n        est = self.getOrDefault(self.estimator)\n        epm = self.getOrDefault(self.estimatorParamMaps)\n        numModels = len(epm)\n        eva = self.getOrDefault(self.evaluator)\n        metricName = eva.getMetricName()\n\n        nFolds = self.getOrDefault(self.numFolds)\n        seed = self.getOrDefault(self.seed)\n        h = 1.0 / nFolds\n\n        randCol = self.uid + \"_rand\"\n        df = dataset.select(\"*\", rand(seed).alias(randCol))\n        metrics = [0.0] * numModels\n\n        for i in range(nFolds):\n            foldNum = i + 1\n            print(\"Comparing models on fold %d\" % foldNum)\n\n            validateLB = i * h\n            validateUB = (i + 1) * h\n            condition = (df[randCol] >= validateLB) & (df[randCol] < validateUB)\n            validation = df.filter(condition)\n            train = df.filter(~condition)\n\n            for j in range(numModels):\n                paramMap = epm[j]\n                model = est.fit(train, paramMap)\n                # TODO: duplicate evaluator to take extra params from input\n                metric = eva.evaluate(model.transform(validation, paramMap))\n                metrics[j] += metric\n\n                avgSoFar = metrics[j] / foldNum\n                print(\"params: %s\\t%s: %f\\tavg: %f\" % (  \n                  {param.name: val for (param, val) in paramMap.items()},\n                    metricName, metric, avgSoFar))\n\n                for (param, val) in paramMap.items():\n                  a.append(param.name)\n                  b.append(val)\n                  c.append(metric)\n                \n        if eva.isLargerBetter():\n            bestIndex = np.argmax(metrics)\n        else:\n            bestIndex = np.argmin(metrics)\n\n        bestParams = epm[bestIndex]\n        bestModel = est.fit(dataset, bestParams)\n        avgMetrics = [m / nFolds for m in metrics]\n        bestAvg = avgMetrics[bestIndex]\n        print(\"Best model:\\nparams: %s\\t%s: %f\" % (\n            {param.name: val for (param, val) in bestParams.items()},\n            metricName, bestAvg))\n        \n        return self._copyValues(CrossValidatorModel(bestModel, avgMetrics))","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\"></div>","arguments":{},"addedWidgets":{},"removedWidgets":[],"datasetInfos":[]},"errorSummary":"<span class=\"ansired\">IndentationError</span><span class=\"ansired\">:</span> uni
